import React from 'react';
import LandingPage from './LandingPage';
import Projects from './Projects';
import BreakPoint from './BreakPoint';
import Intro from './Intro';
import Footer from './footer'

const MainPage = () => {
    return(
        <>
            <LandingPage/>
            <Projects/>
            <BreakPoint/>
            <Intro/>
            <Footer/>
        </>
    )
}

export default MainPage;
